// Helper functions for accessing Torah data
export function getTorahVerse(book: string, chapter: number, verse: number): TorahVerse | null {
  return (TORAH_DATA as any)[book]?.[chapter]?.[verse] || null
}

export function getTorahChapter(book: string, chapter: number): TorahChapter | null {
  return (TORAH_DATA as any)[book]?.[chapter] || null
}

export function getTorahBook(book: string): TorahBook | null {
  return (TORAH_DATA as any)[book] || null
}

export function getAllTorahBooks(): string[] {
  return Object.keys(TORAH_DATA)
}

export function getChapterCount(book: string): number {
  return Object.keys((TORAH_DATA as any)[book] || {}).length
}

export function getVerseCount(book: string, chapter: number): number {
  return Object.keys((TORAH_DATA as any)[book]?.[chapter] || {}).length
}

